#[derive(Copy, Clone, Debug)]
pub struct Warp {
    id: WarpId,
    dest: SpotId,
    time: u32,
    price: Currency,
}
impl world::Accessible for Warp {
    type Context = Context;
    type Currency = Currency;

    fn can_access(&self, ctx: &Context) -> bool {
        ctx.can_afford(&self.price)
            && match self.id {
                WarpId::DroneSave => rules::access_not_within_menu_and_mode__drone(&ctx),
                WarpId::EarthSave => rules::access_within_antarctica(&ctx),
                WarpId::ExitBreach => {
                    rules::access_breach_and_exit_breach_and___flipside_not_within_default(&ctx)
                }
                WarpId::ExitMenu => rules::access_within_menu(&ctx),
                WarpId::FastTravel1710 => {
                    rules::access_not_within_menu_and_not_breach_and_map_17_10_and_fast_travel(&ctx)
                }
                WarpId::IndraSave => {
                    rules::access_not_within_menu_and_amashilama_and_mode__drone(&ctx)
                }
                WarpId::Menu => rules::access_not_within_menu_and_flasks__0(&ctx),
            }
    }
    fn time(&self) -> u32 {
        self.time
    }
    fn price(&self) -> &Currency {
        &self.price
    }
}
impl world::Warp for Warp {
    type WarpId = WarpId;
    type SpotId = SpotId;

    fn id(&self) -> WarpId {
        self.id
    }
    fn dest(&self, ctx: &Context) -> SpotId {
        if self.dest == SpotId::None {
            match self.id {
                WarpId::DroneSave => ctx.save(),
                WarpId::EarthSave => ctx.save(),
                WarpId::ExitBreach => data::flipside(ctx.position()),
                WarpId::ExitMenu => ctx.last(),
                WarpId::FastTravel1710 => {
                    SpotId::Giguna(GigunaSpotId::Giguna__Giguna_Northeast__Save_Point)
                }
                WarpId::IndraSave => ctx.save(),
                WarpId::Menu => SpotId::Menu(MenuSpotId::Menu__Upgrade_Menu__Physiology),
            }
        } else {
            self.dest
        }
    }
    fn connect(&mut self, dest: SpotId) {
        self.dest = dest;
    }
    fn prewarp(&self, ctx: &mut Context) {
        match self.id {
            WarpId::Menu => rules::action_last__position(ctx),
            _ => (),
        }
    }
    fn postwarp(&self, ctx: &mut Context) {
        match self.id {
            WarpId::DroneSave => rules::action_energy__max_energy(ctx),
            WarpId::ExitMenu => rules::action_last__default(ctx),
            WarpId::FastTravel1710 => rules::action_energy__max_energy(ctx),
            WarpId::IndraSave => rules::action_energy__max_energy(ctx),
            _ => (),
        }
    }
    fn should_reload(&self) -> bool {
        match self.id {
            WarpId::DroneSave => true,
            WarpId::EarthSave => true,
            WarpId::ExitBreach => false,
            WarpId::ExitMenu => false,
            WarpId::FastTravel1710 => false,
            WarpId::IndraSave => true,
            WarpId::Menu => false,
        }
    }
}

